import React from "react";
import ContactCard from "./ContactCard";
// import Todoitem from "./Todoitem"
// import Footer from "./components/Footer";
// import Header from "./components/Header";
// import MainContent from "./components/MainContent";
// import "./App.css"

function App(){
    return (
        <div className="contacts">
            <ContactCard
                contact={{name:"Mr.Whiskerson", imgUrl:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSodNkEPlAhrdIOU9TwFmEwj6YvZe5VKytNQ3UgUz0&s", phone:"(212) 555-2345",email:"fluff@me.com"}}

            />
            <ContactCard
                contact={{name:"Vulpix",imgUrl:"https://t4.ftcdn.net/jpg/01/25/64/53/360_F_125645329_Pc6Rn1soUuAZyHgp4DYxXKUXITSFCc1R.jpg",phone: "0259) 666-2345",email:"vulpix@me.com"}}

            />
             <ContactCard
                contact
                name="Lobo"
                imgUrl="https://media.istockphoto.com/id/177794699/photo/grey-wolf-portrait.jpg?s=612x612&w=0&k=20&c=vEUo0UKAKeCIIm35zU0zR7XDOf-4AKXvJWLZGx4BVws=" 
                phone= "(0758) 976-105"
                email= "loboxv@me.com"
            />
             <ContactCard
                name="Ursus"
                imgUrl="https://media.istockphoto.com/id/1030170454/photo/big-brown-bear-standing-on-his-hind-legs.jpg?s=612x612&w=0&k=20&c=zybiQjiaZ7Ay2rTtCEjl5eFgfzvA5mfGcK50sbZbeag=" 
                phone= "(0320) 976-105"
                email= "ursscsdf@me.com"
            /> 
        </div>
    )
}
export default App
